import PreApp from './PreApp';
import {Route,Switch} from 'react-router-dom'



const PrePreApp=()=>{



return (

<div>

<Switch>

   <Route exact path='/createaccount/' >
        <div> abc testing</div>
   </Route>


   <Route exact path='/' >
        <PreApp/>
   </Route>	




</Switch>




</div>
);
}

export default PrePreApp;
